column6:
Жилье посуточно в центре Киева. Без комиссии.

Метро - 1 минута пешком.

К Вашим услугам:
 
 - БЕСПЛАТНЫЙ интернет WI-FI;
 - стиральная машинка
 - микроволнова печь;
 - холодильник;
 - утюг;
 - телевизор 170 каналов;
 - постельное белье + одеяло;
 - необходимая посуда.
 
Приятная атмосфера и порядок Вас порадуют.

Тел.
